44','2018-07-15 13:56:44','','library-hero','','inherit','open','closed','','library-hero','','','2018-07-15 13:56:44','2018-07-15 13:56:44','',59,'http://college.ti/wp-content/uploads/2018/07/library-hero.jpg',0,'attachment','image/jpeg',0),(69,1,'2018-07-15 13:56:45','2018-07-15 13:56:45','','ocean','','inherit','open','closed','','ocean','','','2018-07-15 13:56:45','2018-07-15 13:56:45','',59,'http://college.ti/wp-content/uploads/2018/07/ocean.jpg',0,'attachment','image/jpeg',0),(71,1,'2018-07-15 14:13:46','2018-07-15 14:13:46','','Page Banner','','publish','closed','closed','','acf_page-banner','','','2018-07-15 14:20:58','2018-07-15 14:20:58','',0,'http://college.ti/?post_type=acf&#038;p=71',0,'acf','',0),(72,1,'2018-07-15 14:45:18','2018-07-15 14:45:18','One morning, when Gregor Samsa woke from troubled dreams, he found himself transformed in his bed into a horrible vermin. He lay on his armour-like back, and if he lifted his head a little he could see his brown belly, slightly domed and divided by arches into stiff sections.\r\n\r\nThe bedding was hardly able to cover it and seemed ready to slide off any moment. His many legs, pitifully thin compared with the size of the rest of him, waved about helplessly as he looked. “What’s happened to me? ” he thought. It wasn’t a dream. His room, a proper human room although a little too small, lay peacefully between its four familiar walls.','About Us','','inherit','closed','closed','','15-revision-v1','','','2018-07-15 14:45:18','2018-07-15 14:45:18','',15,'http://college.ti/2018/07/15/15-revision-v1/',0,'revision','',0),(73,1,'2018-07-16 06:32:09','2018-07-16 06:32:09','Bring poems you’ve wrote to the 100 building this Tuesday for an open mic and snacks. Bring poems you’ve wrote to the 100 building this Tuesday for an open mic and snacks. Bring poems you’ve wrote to the 100 building this Tuesday for an open mic and snacks. Bring poems you’ve wrote to the 100 building this Tuesday for an open mic and snacks. Bring poems you’ve wrote to the 100 building this Tuesday for an open mic and snacks.','Third Prof','','inherit','closed','closed','','59-autosave-v1','','','2018-07-16 06:32:09','2018-07-16 06:32:09','',59,'http://college.ti/2018/07/16/59-autosave-v1/',0,'revision','',0),(74,1,'2018-07-17 13:00:12','2018-07-17 13:00:12','Experience heartfelt worship, good friends and a refreshing look into God’s Word in a comfortable, casual setting. Spring, Summer, and Fall semesters offered. Church is committed to coming alongside families in a way that helps strengthen and grow them. We know that well-refreshed moms make well-refreshed families, and that is what Moments is all about.','Muea','Experience heartfelt worship, good friends and a refreshing look into God’s Word in a comfortable, casual setting.','publish','closed','closed','','muea','','','2018-07-17 13:24:05','2018-07-17 13:24:05','',0,'http://college.ti/?post_type=campus&#038;p=74',0,'campus','',0),(75,1,'2018-07-17 13:01:18','2018-07-17 13:01:18','<div class=\"wpb_text_column wpb_content_element aligncenter\">\r\n<div class=\"wpb_wrapper\">\r\n\r\nOnline giving is simple, easy, and also reduces post office trips, postage costs and weekly/monthly check-writing chores. When you participate in online giving, you’re also helping to streamline administrative overhead costs – thus, putting more of your dollars to work in the ministries. God always blesses that kind of faith!\r\n\r\n</div>\r\n</div>','Bonduma','Online giving is simple, easy, and also reduces post office trips, postage costs and weekly/monthly check-writing chores.','publish','closed','closed','','bonduma','','','2018-07-17 13:23:00','2018-07-17 13:23:00','',0,'http://college.ti/?post_type=campus&#038;p=75',0,'campus','',0),(76,1,'2018-07-17 13:02:11','2018-07-17 13:02:11','During the weekend services (and mid-week services) we have a time of dedicating our tithes and offerings to God in prayer. This is an opportunity to give to God during the service. If you have real property, assets, or something you want to bequeath as a gift, please contact John Doe to discuss ahead of time either by e-mail: Doe@youdomain.com','Bonanjo','Once again, consider gathering together as a family to dedicate what you give in prayer, asking God to accomplish spiritual results – especially that many would come to faith in Jesus Christ','publish','closed','closed','','bonanjo','','','2018-07-17 13:21:21','2018-07-17 13:21:21','',0,'http://college.ti/?post_type=campus&#038;p=76',0,'campus','',0),(77,1,'2018-07-17 13:04:12','2018-07-17 13:04:12','','Location','','publish','closed','closed','','acf_location','','','2018-07-17 13:04:12','2018-07-17 13:04:12','',0,'http://college.ti/?post_type=acf&#038;p=77',0,'acf','',0),(79,1,'2018-07-18 04:24:29','2018-07-18 04:24:29','','Related Campus(es)','','publish','closed','closed','','acf_related-campuses','','','2018-07-18 04:24:29','2018-07-18 04:24:29','',0,'http://college.ti/?post_type=acf&#038;p=79',0,'acf','',0),(80,1,'2018-07-27 02:50:35','2018-07-27 02:50:35','','Program Content Body','','publish','closed','closed','','acf_program-content-body','','','2018-07-27 02:50:35','2018-07-27 02:50:35','',0,'http://college.ti/?post_type=acf&#038;p=80',0,'acf','',0),(81,1,'2018-07-27 03:07:22','2018-07-27 03:07:22','','Search','','publish','closed','closed','','search','','','2018-07-27 03:07:22','2018-07-27 03:07:22','',0,'http://college.ti/?page_id=81',0,'page','',0),(82,1,'2018-07-27 03:07:17','2018-07-27 03:07:17','','Search','','inherit','closed','closed','','81-revision-v1','','','2018-07-27 03:07:17','2018-07-27 03:07:17','',81,'http://college.ti/2018/07/27/81-revision-v1/',0,'revision','',0),(83,1,'2018-07-29 18:50:00','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2018-07-29 18:50:00','0000-00-00 00:00:00','',0,'http://college.ti/?p=83',0,'post','',0),(84,1,'2018-07-29 19:40:43','2018-07-29 19:40:43','','My Notes','','publish','closed','closed','','my-notes','','','201